import {
    VideoIcon,
    AppleIcon,
    SearchIcon,
    BellIcon,
    UserIcon,
    Camera,
    Video
} from "lucide-react";
import React, { useEffect, useRef } from "react";
import { motion, useAnimation, useInView } from "framer-motion";

const IndexPage = () => {
    return (
        <div className="min-h-screen bg-gradient-to-b from-gray-900 to-black text-white overflow-hidden">
            <HeroSection />
            <LandingSection />
        </div>
    );
};

const HeroSection = () => {
    return (
        <div
            className="bg-gradient-to-b from-gray-900 to-black text-white min-h-screen flex flex-col relative overflow-hidden" >
            <div className="absolute inset-0 z-0">
                <div
                    className="absolute top-0 left-1/4 w-0.5 h-full bg-gradient-to-b from-blue-500 to-transparent opacity-20" ></div>
                <div
                    className="absolute top-0 right-1/4 w-0.5 h-full bg-gradient-to-b from-blue-500 to-transparent opacity-20" ></div>
                <div
                    className="absolute top-1/4 left-0 w-full h-0.5 bg-gradient-to-r from-transparent via-blue-500 to-transparent opacity-20" ></div>
                <div
                    className="absolute bottom-1/4 left-0 w-full h-0.5 bg-gradient-to-r from-transparent via-blue-500 to-transparent opacity-20" ></div>
            </div>

            <header
                className="flex justify-between items-center p-4 md:p-6 fixed top-4 left-0 right-0 z-50" >
                <div className="text-2xl font-bold">
                    LoopSync
                </div>
                <nav
                    className="bg-gray-800 bg-opacity-80 backdrop-filter backdrop-blur-lg rounded-full px-8 py-4 shadow-lg flex items-center space-x-8" >
                    <a
                        href="#"
                        className="hover:text-gray-300 transition duration-300" >
                        About Us
                    </a>
                    <a
                        href="#"
                        className="hover:text-gray-300 transition duration-300" >
                        Terms Of Service
                    </a>
                    <a
                        href="#"
                        className="hover:text-gray-300 transition duration-300" >
                        Help Center
                    </a>
                    <SearchIcon
                        className="text-gray-400 hover:text-white cursor-pointer transition duration-300"
                        size={20} />
                    <BellIcon
                        className="text-gray-400 hover:text-white cursor-pointer transition duration-300"
                        size={20} />
                    <UserIcon
                        className="text-gray-400 hover:text-white cursor-pointer transition duration-300"
                        size={20} />
                </nav>
                <button
                    className="bg-gray-800 text-white px-4 py-2 rounded-full flex items-center" >
                    <span className="mr-2">
                        Download For
                    </span>
                    <AppleIcon size={20} />
                </button>
            </header>

            <main
                className="flex-grow flex flex-col items-center justify-center text-center px-4 mt-24 relative z-30" >
                <div className="max-w-4xl mx-auto mt-12">
                    <h1
                        className="text-5xl md:text-7xl font-bold mb-8" >
                        Turn{" "}
                        <VideoIcon
                            className="inline-block mx-2 text-blue-500"
                            size={64} />{" "}
                        Meetings
                        <br />
                        Into Action
                    </h1>
                    <p className="text-xl md:text-2xl mb-12">
                        Automate Summaries And Track Tasks Effortlessly With AI-Powered
                        Meeting Intelligence
                    </p>
                    <button
                        className="bg-blue-600 text-white text-xl px-8 py-4 rounded-full hover:bg-blue-700 transition duration-300" >
                        Try Free &rarr;
                    </button>
                </div>
            </main>

            <div
                className="absolute inset-0 pointer-events-none z-20" >
                <div
                    className="h-full w-full flex items-center justify-center" >
                    <div
                        className="border border-gray-700 w-3/4 h-3/4 rounded-3xl mt-12 bg-gradient-to-b from-gray-800 to-transparent opacity-30" ></div>
                </div>
            </div>

            <div className="absolute inset-0 z-10">
                <div
